import {Button} from 'antd'
import './writing.less'

export default class writing extends Component {
    
    render() {
        return (
            <div className="writing_div">
                <div className="writing_left">
                <Link to="/home">
                <Button className="writing_left" type="primary" shape="round"  size='large' ghost='true'>
                    回首页
                </Button></Link>
                </div>
                {/* <RichTextEditor/> */}
            </div>
        )
    }
}
